import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, TouchableOpacity, KeyboardAvoidingView, Image } from 'react-native';
import { Button, TextInput } from 'react-native-paper';

// <View style={styles.container}>
export default function SignUp() {
  return (
    <>
      <KeyboardAvoidingView behavior="position">

        <StatusBar style="light" backgroundColor="black" barStyle="light-content" />
        <Image style={styles.logoStyle} source={require('../assets/logoBlack.png')} />

        <Text style={styles.intro}> Create Account.</Text>
        <Text style={styles.subIntro}>Sign up to get started!</Text>


        <TextInput style={styles.textInpStyle} theme={{ colors: { primary: "red" } }}
          label="Name" mode="outlined" />
        <TextInput style={styles.textInpStyle} theme={{ colors: { primary: "red" } }}
          label="Email" mode="outlined" />
        <TextInput style={styles.textInpStyle} theme={{ colors: { primary: "red" } }}
          label="Password" mode="outlined" />
        <TextInput style={styles.textInpStyle} theme={{ colors: { primary: "red" } }}
          label="Organization" mode="outlined" />
        <TextInput style={styles.textInpStyle} theme={{ colors: { primary: "red" } }}
          label="Role" mode="outlined" />
        <TextInput style={styles.textInpStyle} theme={{ colors: { primary: "red" } }}
          label="Country" mode="outlined" />
        <Button style={styles.btnStyle} mode="contained" onPress={() => console.log('Pressed')}>
          SIGN UP
  </Button>
  <TouchableOpacity>
        <Text style={styles.subText} >I'm already a member <Text style={styles.spIn}> Sign In</Text> </Text>
       </TouchableOpacity>


      </KeyboardAvoidingView>

    </>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  intro: {
    fontSize: 30,
    marginLeft: 14,
    marginTop: 10,
    color: "#3b3b3b",
    fontWeight: "bold"
  },
  spIn: {
    fontWeight: "bold",
    fontFamily: "",
    color: "blue"
  },
  subIntro: {
    marginTop: 8,
    fontSize: 20,
    marginLeft: 22,
    color: "black"
  },
  selfClosing: {
    borderBottomColor: "red",
    borderBottomWidth: 2,
    marginLeft: 18,
    marginRight: 70,
    marginTop: 0,
    marginBottom: 10
  },
  titleM: {
    fontSize: 20,
    marginLeft: 18,
    textAlign: "center",
    marginTop: 5,
  },
  textInpStyle: {
    marginLeft: 18,
    marginRight: 18,
    marginTop: 2,
    backgroundColor: "white",
    height: 40,
    width: "auto",
    borderWidth: 0,



  },
  btnStyle: {
    marginLeft: 18,
    marginRight: 18,
    marginTop: 10,
    backgroundColor: "black",
    textShadowColor: "white",
    borderRadius: 35
  },
  subText: {
    fontSize: 15,
    marginLeft: 18,
    marginTop: 5,
    textAlign: "center"
  },
  logoStyle: {
    marginLeft: 140,
    marginTop: 50,
    height: 140,
    width: 130
  }
});
